//import { useState } from 'react'

function Containers() {
  //const [count, setCount] = useState(0)

  const containerIdInput = document.getElementById("containerId");

  function stopContainer() {
    let data = JSON.stringify(containerIdInput.value);
    console.log(data)
    let url = encodeURI("http://localhost:8080/docker/stop")
    fetch(url, {
      method: "POST",
      mode: "no-cors",
      headers: {
        "Content-Type": "application/json",
      },
      body: data,
    })
    .then((response) => {
      console.log("response.headers =", response.headers);
      return response.blob();
    })
    .then(data => {
      console.log(data);
    });
  };

  return (
    <>
      <button onClick={stopContainer}>Stop Container</button>
    </>
  )
};

export default Containers
